import React, {Component} from 'react';
import HighchartsReact from 'highcharts-react-official';
import Highcharts from 'highcharts';
import HighchartsSunburst from 'highcharts/modules/sunburst';
import data from './data';
import './datavis.css';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
HighchartsSunburst(Highcharts);

const options = [
  'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'
];

class DataVisualization extends Component {

  onSelect(event){
    console.log(event);
  }

  render() {
    var data = [{
      'id': '0.0',
      'parent': '',
      'name': 'TCI'
    },
    {
      'id': '1.2',
      'parent': '0.0',
      'name': 'CM'
    },
    {
      'id': '1.1',
      'parent': '0.0',
      'name': 'AS'
    },
    {
      'id': '2.1',
      'parent': '1.1',
      'name': 'R&D',
      'value': 104
    },
    {
      'id': '2.5',
      'parent': '1.1',
      'name': 'AE',
      'value': 90
    },
    {
      'id': '2.3',
      'parent': '1.1',
      'name': 'Engineering Learning Center ',
      'value': 51
    },
    {
      'id': '2.2',
      'parent': '1.1',
      'name': 'Human Resources',
      'value': 51
    },
    {
      'id': '2.4',
      'parent': '1.1',
      'name': 'Accessories',
      'value': 43
    },
    {
      'id': '2.9',
      'parent': '1.2',
      'name': 'Accounts and Finance',
      'value': 30
    },
    {
      'id': '2.8',
      'parent': '1.2',
      'name': 'FO',
      'value': 56
    },
    {
      'id': '2.7',
      'parent': '1.2',
      'name': 'CD',
      'value': 129
    },
    {
      'id': '2.6',
      'parent': '1.2',
      'name': 'CA',
      'value': 109
    }
  ];

    let chartConfig = {
      series: [
        {
          type: "sunburst",
          data: data,
          allowDrillToNode: true,
          cursor: "pointer",
          dataLabels: {
            borderWidth: 0,
            filter: { property: "innerArcLength", operator: ">", value: 16 },
            style: { textShadow: false, textOutline: null, color: "contrast" }
          },
          levels: [
            {
              level: 1,
              levelIsConstant: false,
              dataLabels: {
                filter: { property: "outerArcLength", operator: ">", value: 64 }
              },
              colorByPoint: true
            },
            { level: 2, colorVariation: { key: "brightness", to: -0.3 } },
            { level: 3, colorVariation: { key: "brightness", to: -0.3 } }
          ]
        }
      ]
    };

    return (
      <div>
        <DropdownButton 
          id="dropdown-item-button" 
          title="Choose a TimeStamp"
        >
          <Dropdown.Item as="button">Monday</Dropdown.Item>
          <Dropdown.Item as="button">Tuesday</Dropdown.Item>
          <Dropdown.Item as="button">Wednesday</Dropdown.Item>
          <Dropdown.Item as="button">Thursday</Dropdown.Item>
          <Dropdown.Item as="button">Friday</Dropdown.Item>
          <Dropdown.Item as="button">Saturday</Dropdown.Item>
          <Dropdown.Item as="button">Sunday</Dropdown.Item>
        </DropdownButton>

        <HighchartsReact
          constructorType={"chart"}
          highcharts={Highcharts}
          options={chartConfig}
        />
      </div>
    );
  }
}

export default DataVisualization;
